import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";
  import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';

  function AboutMe() {
    return (
        <Container
        fixed
        sx={{
          bgcolor: "transparent",
          marginTop: '10vh', 
          marginBottom: '10vh',
        }}
        >
            <h1>About Me</h1>
            <Box spacing={2}>
                <Typography>
                    I am a university student studying a Bachelor of Computer Science at Swinburne University and an currently in my second year. 
                    So far in my course i have averaged a distinction grade (70%+) and am working towards getting an AWS assocaite solutions architect certificate.
                    Over the past two years i've developed skills in SQL databases, C++/C# and javascript. With completling my degree i aim to become a
                    software developer. Below you can find my contact information.
                </Typography>
                <Stack direction="row" spacing={2}>
                    <Box>
                        <PhoneIcon />
                        <p>0481961986</p>
                    </Box>
                    <Box>
                        <EmailIcon/>
                        <p>Neno701@outlook.com</p>
                    </Box>
                </Stack>
            </Box>
        </Container>
    )
  };

  export default AboutMe;
